  false,\n\t\"url\": null,\n\t\"notes\": \"Glider deployed to perform cross canyon
  transects of Palmer Deep within the operating CODAR fields off of Anvers Island.
  This multi-platform field study will investigate the impact of coastal physical
  processes (e.g. tides, currents, upwelling events, sea-ice) on Adu00c3u00afu00c2u00bfu00c2u00bdu00c3u00afu00c2u00bfu00c2u00bdlie
  penguin foraging ecology in the vicinity of Palmer Deep, off Anvers Island, WAP.
  Guided by real-time surface convergence and divergences based on remotely sensed
  surface current maps derived from a coastal network of High Frequency Radars (HFRs),
  a multidisciplinary research team will adaptively sample the distribution of phytoplankton
  and zooplankton, which influence Adu00c3u00afu00c2u00bfu00c2u00bdu00c3u00afu00c2u00bfu00c2u00bdlie
  penguin foraging ecology, to understand how local oceanographic processes structure
  the ecosystem.The Long Term Ecological Research (LTER) program in Antarctica is
  a long term study focused on understanding how the marine system regulates the ecology
  of the West Antarctic Peninsula. The project is focused on how the ecology is changing
  given the West Antarctic Peninsula is the fastest winter warming place on Earth.nnThe
  National Centers for Environmental Information (NCEI) received the data in this
  archival package from the Integrated Ocean Observing System's National Glider Data
  Assembly Center (IOOS NGDAC). The IOOS NGDAC received the data in one or more netCDF
  files comprising an entire glider deployment. The data are measurements of physical
  oceanographic properties such as temperature, salinity, conductivity, and density.
  The IOOS NGDAC checked the files for compliance to their netCDF file convention,
  aggregated the files into a single netCDF file, and then submitted the file to NCEI
  for long-term preservation.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
